settings.markerImageFunction:
var azimuth = dsData[dsIndex]['azimuth']
var res = {
    size: 500
}

for (let i = 0; i < 36; i++) {
    if (i * 10 <= azimuth && azimuth <= i * 10 + 10) {
        res.url = images[i]
        return res
    }
}
